  "devdoc": {
    "details": "The base contract of Xaya on an EVM chain.  This manages user accounts (names) as NFTs, and handles moves sent by them. The contract itself is not upgradable, but it has an owner which is able to modify the policy for name/move validation, fees and the NFT metadata generation (but nothing else).",
    "events": {
      "PolicyChangeScheduled(address,uint256)": {
        "details": "Emitted when a new policy change is scheduled.  "
      },
      "PolicyChanged(address,address)": {
        "details": "Emitted when a policy change takes effect.  "
      }
    },
    "kind": "dev",
    "methods": {
      "approve(address,uint256)": {
        "details": "See {IERC721-approve}."
      },
      "balanceOf(address)": {
        "details": "See {IERC721-balanceOf}."
      },
      "constructor": {
        "details": "Constructs the token contract.  It accepts the (immutable) WCHI token address as well as the (changable) initial policy as arguments."
      },
      "contractURI()": {
        "details": "Returns a link to the contract-level metadata used by OpenSea."
      },
      "enactPolicyChange()": {
        "details": "Enacts a policy change after the timelock is over.  This function can be called by anyone, not only the owner."
      },
      "exists(string,string)": {
        "details": "Returns true if the given namespace/name combination exists."
      },
      "exists(uint256)": {
        "details": "Returns true if the given token ID exists."
      },
      "getApproved(uint256)": {
        "details": "See {IERC721-getApproved}."
      },
      "isApprovedForAll(address,address)": {
        "details": "See {IERC721-isApprovedForAll}."
      },
      "move(string,string,string,uint256,uint256,address)": {
        "details": "Sends a move with a given name, optionally attaching a WCHI payment to the given receiver.  For no payment, amount and receiver should be set to zero. If a nonce other than uint256.max is passed, then the move is valid only if it matches exactly the account's next nonce.  The nonce used is returned."
      },
      "name()": {
        "details": "See {IERC721Metadata-name}."
      },
      "owner()": {
        "details": "Returns the address of the current owner."
      },
      "ownerOf(uint256)": {
        "details": "See {IERC721-ownerOf}."
      },
      "permitOperator(address,bytes)": {
        "details": "Gives operator approval to manage all names (tokens) owned by the signer of the permit message.  This method can be called by anyone, so it can be used for native meta transactions.  Returns the signer address extracted from the signature."
      },
      "permitOperatorMessage(address)": {
        "details": "Returns the message that needs to be signed for permitOperator."
      },
      "register(string,string)": {
        "details": "Registers a new name.  The newly minted account NFT will be owned by the caller.  Returns the token ID of the new account."
      },
      "renounceOwnership()": {
        "details": "Leaves the contract without owner. It will not be possible to call `onlyOwner` functions anymore. Can only be called by the current owner. NOTE: Renouncing ownership will leave the contract without an owner, thereby removing any functionality that is only available to the owner."
      },
      "safeTransferFrom(address,address,uint256)": {
        "details": "See {IERC721-safeTransferFrom}."
      },
      "safeTransferFrom(address,address,uint256,bytes)": {
        "details": "See {IERC721-safeTransferFrom}."
      },
      "schedulePolicyChange(address)": {
        "details": "Schedules an update to the policy implementation."
      },
      "setApprovalForAll(address,bool)": {
        "details": "See {IERC721-setApprovalForAll}."
      },
      "supportsInterface(bytes4)": {
        "details": "See {IERC165-supportsInterface}."
      },
      "symbol()": {
        "details": "See {IERC721Metadata-symbol}."
      },
      "tokenByIndex(uint256)": {
        "details": "See {IERC721Enumerable-tokenByIndex}."
      },
      "tokenIdForName(string,string)": {
        "details": "Computes the token ID deterministically (as hash) from the namespace/name combination."
      },
      "tokenIdToName(uint256)": {
        "details": "For an existing account, return the namespace and name corresponding to a token ID."
      },
      "tokenOfOwnerByIndex(address,uint256)": {
        "details": "See {IERC721Enumerable-tokenOfOwnerByIndex}."
      },
      "tokenURI(uint256)": {
        "details": "Returns a constructed metadata URI for the NFT.  This is based on the NFT's associated namespace and name."
      },
      "totalSupply()": {
        "details": "See {IERC721Enumerable-totalSupply}."
      },
      "transferFrom(address,address,uint256)": {
        "details": "See {IERC721-transferFrom}."
      },
      "transferOwnership(address)": {
        "details": "Transfers ownership of the contract to a new account (`newOwner`). Can only be called by the current owner."
      }
    },
    "stateVariables": {
      "nextNonce": {
        "details": "Mapping of token IDs to the next nonce for that account.  "
      },
      "nextPolicy": {
        "details": "If the policy is being changed, the next policy.  "
      },
      "nextPolicyAfter": {
        "details": "If the policy is being changed, the timestamp after which nextPolicy can be enacted as current policy.  This is zero if there is no current change going on."
      },
      "policy": {
        "details": "The address of the current policy contract.  "
      },
      "policyTimelock": {
        "details": "Time lock for policy changes.  "
      },
      "tokenIdToAccount": {
        "details": "For existing accounts, mapping of token ID to name.  "
      },
      "wchiToken": {
        "details": "The address of the WCHI token used.  "
      }
    },
    "version": 1
  },
